description:
GENRE: Comedy, Documentary
YEAR: 2013

Follows two years in the life of Greg Sommer, aka Skull Man, as he builds the Canadian chapter of Box Wars, an international underground movement of cardboard-based combat. An off-the-wall documentary full of humour, heavy metal, insane combat, and edgy-fun.

